import Menu from "./Menu";
import Logo from "./Logo";

export default function Header() {
  return (
    <header>
      <Logo />
      <Menu />

      <style jsx>
        {`
          header{
            display: flex,
            justifyContent: space-between,
            width: 100%,
            alignItems: center
          }

          ul{
            display: flex,
            justifyContent: "space-between",
            listStyleType: none,
            paddingInlineStart: 0
          }

          li{
              marginLeft: '2em'
          }

          `}
      </style>
    </header>
  );
}
